import React from "react";
import "./App.css";
import Header from "./components/Header/Header";
import MemeGenerator from "./components/MemeGenerator/MemeGenerator";

function App() {
  return (
    <div className="App">
      <h1>These are the components:</h1>
      <Header />
      <MemeGenerator />
    </div>
  );
}

export default App;
